import React from "react";
import { Prism as SyntaxHighlighter } from "react-syntax-highlighter";
import { coy } from "react-syntax-highlighter/dist/esm/styles/prism";

const InsertionSortPage = () => {
  const cppCode = `
#include <iostream>
using namespace std;

void insertionSort(int arr[], int n) {
    for (int i = 1; i < n; i++) {
        int key = arr[i];
        int j = i - 1;

        while (j >= 0 && arr[j] > key) {
            arr[j + 1] = arr[j];
            j = j - 1;
        }
        arr[j + 1] = key;
    }
}

int main() {
    int arr[] = {12, 11, 13, 5, 6};
    int n = sizeof(arr) / sizeof(arr[0]);
    insertionSort(arr, n);

    cout << "Array ordenado: ";
    for (int i = 0; i < n; i++)
        cout << arr[i] << " ";
    return 0;
}
`;

  return (
    <div style={{ padding: "20px" }}>
      <h1>Algoritmo de Ordenamiento por Inserción</h1>
      <p>
        El ordenamiento por inserción es un algoritmo eficiente para ordenar
        pequeños conjuntos de datos. Iterativamente construye la lista ordenada
        desplazando elementos según sea necesario.
      </p>
      <h2>Código en C++</h2>
      <SyntaxHighlighter language="cpp" style={coy}>
        {cppCode}
      </SyntaxHighlighter>
    </div>
  );
};

export default InsertionSortPage;
